    this.$axios.get('/types/all')
      .then((response) => {
        const a = [];
        response.data.forEach((e) => {
          a.push(e.id);
        });
        this.pokemonTypes = a;
      })
      .catch((error) => console.log(error));
  }

  getPokemon() {
    this.loading = true;
    this.$q.notify({
      color: 'primary',
      message: 'counting pokemon...',
    });

    this.$axios.get('/pokemon/all')
      .then((response) => {
        console.log(response);
        this.pokemons = response.data;
        this.$q.notify({
          color: 'primary',
          message: 'Gotcha!',
        });
      })
      .catch((error) => {
        console.log(error);
        this.$q.notify({
          color: 'danger',
          message: error.message,
        });
      })
      .finally(() => {
        this.loading = false;
      });
  }

