    const r = Math.floor(Math.random() * this.pokemonTypes.length);
    const type1 = this.pokemonTypes[r];
    const type2 = this.pokemonTypes[r - 1 < 0 ? this.pokemonTypes.length - 1 : r - 1];
    return [type1, type2];
  }

