      color: 'primary',
      message: `fetching pokemon with id at least ${this.searchID}`,
    });

    this.$axios.post('/pokemon/search', {
      pokemon_id: this.searchID,
    })
      .then((response) => {
        console.log(response);
        this.pokemons = response.data;
        this.$q.notify({
          color: 'primary',
          message: 'Gotcha!',
        });
      })
      .catch((error) => {
        console.log(error);
        this.$q.notify({
          color: 'danger',
          message: error.message,
        });
      });
  }

