    this.loading = true;
    this.$q.notify({
      color: 'primary',
      message: 'Breeding pokemon...',
    });

    const types = this.getRandomTypes();
    this.$axios.post('/pokemon/create', {
      hp: 99,
      attack: 99,
      defense: 99,
      specialAttack: 99,
      specialDefense: 99,
      speed: 99,
      types,
    })
      .then((response) => {
        this.$q.notify({
          color: 'primary',
          message: `${response.data.message}! Say hello to the new pokemon!`,
        });
        this.getPokemon();
      })
      .catch((error) => {
        console.log(error);
      })
      .finally(() => {
        this.loading = false;
      });
  }

  updatePokemon(row) {
    this.loading = true;
    this.$q.notify({
      color: 'primary',
      message: 'updating pokemon...',
    });

    this.$axios.post('/pokemon/update', {
      pokemon_id: row.pokemon_id,
      hp: row.hp,
      attack: row.attack,
      defense: row.defense,
      specialAttack: row.specialAttack,
      specialDefense: row.specialDefense,
      speed: row.speed,
    })
      .then((response) => {
        this.$q.notify({
          color: 'primary',
          message: response.data.message,
        });
      })
      .catch((error) => {
        this.$q.notify({
          color: 'danger',
          message: error.message,
        });
      })
      .finally(() => {
        this.loading = false;
      });
  }

  deletePokemon(id) {
    this.$q.notify({
      color: 'primary',
      message: `deleting pokemon with id ${id}`,
    });

    this.$axios.post('/pokemon/delete', {
      pokemon_id: id,
    })
      .then((response) => {
        this.$q.notify({
          color: 'primary',
          message: response.data.message,
        });
      })
      .catch((error) => {
        this.$q.notify({
          color: 'danger',
          message: error.message,
        });
      })
      .finally(() => {
        this.getPokemon();
      });
  }
}

